import React from "react";
import LivroLista from "./LivroLista";
import "./App.css";

import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";

function App() {
    return (
        <Router>
            <div className='App'>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/livros">Livros</Link>
                        </li>
                    </ul>
                </nav>
                <Switch>
                    <Route exact path="/">
                        <h1>Home</h1>
                    </Route>
                    <Route path="/livros">
                        <LivroLista />
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}

export default App;
